import React, { Component } from 'react';
import './App.css';
import NavBar from './Components/NavBar/NavBar'

class App extends Component {

  state = {
    currentPage: null,
    word: "Test"
  }



  render() {
    return (


      <div>
        <h1>ryan slevin</h1>
        <NavBar />
        <p>{this.state.test}</p>

      </div>
    );

  }

}

export default App;
